import "./ExpanseItem.css";
function ExpanseItem(){
    const expanseDate = new Date(2021,10,30);
    const expanseTitle = 'Car Insaurance';
    const expanseAmount = 220;
    return(
        <div className="expanse">
            <div className="expanse_date">
                <h2>{expanseDate.toISOString()}</h2>
            </div>
            <div className="expanse_item">
                <h3>{expanseTitle}</h3>
                <p>${expanseAmount}</p>
            </div>
        </div>
    );
}

export default ExpanseItem;
